import React from 'react';

function Certificate() {
  return (
    <div className="certificate">
      <h2>Certificate</h2>
      <div className="certificateitem">
        <strong>AWS Solutions Architect Associate Certification (2024.08)</strong>
        <strong>GCP Associate Cloud Engineer Certification (2024.07)</strong>
    </div>
  </div>
  );
}

export default Certificate;
